from pathfinding.core.grid import Grid
from pathfinding.finder.a_star import AStarFinder
import pexpect


def tuplesub(a, b):
    return tuple([a[0]-b[0], a[1]-b[1]])


def findreplace(grid, char):
    coords = False
    checky = 0
    while not coords:
        if char in grid[checky]:
            coords = [int(checky), grid[checky].index(char)]
            grid[checky][coords[1]] = "1"
        else:
    	    checky+= 1
    return coords[::-1]


def pathfind(inputmatrix):
    formatmatrix = inputmatrix.replace(" ", "1").replace("#", "0")
    matrix = [list(line) for line in formatmatrix.split("\n")]

    startcoords = findreplace(matrix, "p")
    endcoords = findreplace(matrix, "x")

    grid = Grid(matrix=matrix)

    start = grid.node(*startcoords)
    end = grid.node(*endcoords)
    
    finder = AStarFinder()
    path, runs = finder.find_path(start, end, grid)
    
    routestr = ""
    for index in range(1, len(path)):
        routestr += directdict[tuplesub(path[index], path[index-1])]
    routestr = "".join([char for index, char in enumerate(routestr) if index % 2 == 0])
    #print(path)
    print(routestr)


